import { useEffect, useState } from "react";
import { fetchTasks, addTask, updateTask, deleteTask } from "../services/api";
import useAuth from "../contexts/useAuth";

const DashboardPage = () => {
  const { token, logout } = useAuth();
  const [tasks, setTasks] = useState([]);
  const [filter, setFilter] = useState("all");
  const [newTask, setNewTask] = useState({ title: "", description: "", priority: "Medium" });

  useEffect(() => {
    loadTasks();
  }, []);

  const loadTasks = async () => {
    const res = await fetchTasks(token);
    if (Array.isArray(res)) setTasks(res);
  };

  const handleAddTask = async () => {
    if (!newTask.title) return alert("Title required");
    const res = await addTask(token, newTask);
    if (res._id) {
      setTasks([...tasks, res]);
      setNewTask({ title: "", description: "", priority: "Medium" });
    }
  };

  const handleDelete = async (id) => {
    await deleteTask(token, id);
    setTasks(tasks.filter(t => t._id !== id));
  };

  const handleToggle = async (id, currentStatus) => {
    const res = await updateTask(token, id, { status: !currentStatus });
    if (res._id) {
      setTasks(tasks.map(t => t._id === id ? { ...t, status: res.status } : t));
    }
  };

  const filteredTasks = tasks.filter(task => {
    if (filter === "all") return true;
    return filter === "completed" ? task.status : !task.status;
  });

  return (
    <div className="p-6 max-w-3xl mx-auto">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold">Your Tasks</h2>
        <button onClick={logout} className="bg-red-500 text-white px-4 py-1 rounded">Logout</button>
      </div>

      <div className="mb-4 flex gap-2">
        <input placeholder="Title" className="border p-2 rounded w-1/3"
          value={newTask.title} onChange={(e) => setNewTask({ ...newTask, title: e.target.value })} />
        <input placeholder="Description" className="border p-2 rounded w-1/3"
          value={newTask.description} onChange={(e) => setNewTask({ ...newTask, description: e.target.value })} />
        <select className="border p-2 rounded" value={newTask.priority}
          onChange={(e) => setNewTask({ ...newTask, priority: e.target.value })}>
          <option>Low</option>
          <option>Medium</option>
          <option>High</option>
        </select>
        <button onClick={handleAddTask} className="bg-blue-600 text-white px-3 py-2 rounded">Add</button>
      </div>

      <div className="flex gap-3 mb-4">
        {["all", "active", "completed"].map(f => (
          <button key={f}
            className={`px-3 py-1 rounded ${filter === f ? "bg-blue-500 text-white" : "bg-gray-200"}`}
            onClick={() => setFilter(f)}>
            {f.charAt(0).toUpperCase() + f.slice(1)}
          </button>
        ))}
      </div>

      <ul>
        {filteredTasks.map(task => (
          <li key={task._id} className="flex justify-between items-center bg-white p-3 mb-2 rounded shadow">
            <div>
              <h3 className={`font-semibold ${task.status ? "line-through" : ""}`}>{task.title}</h3>
              <p className="text-sm text-gray-600">{task.description}</p>
              <span className="text-xs text-gray-500">Priority: {task.priority}</span>
            </div>
            <div className="flex gap-2">
              <button onClick={() => handleToggle(task._id, task.status)}
                className="text-green-600">{task.status ? "Undo" : "Done"}</button>
              <button onClick={() => handleDelete(task._id)} className="text-red-500">Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DashboardPage;
